{\pard \ql \f0 \sa180 \li0 \fi0 This repository contains a set of REAPER scripts dedicated to algorithm composition, adaptive music, and interfacing with external software. They must be installed via ReaPack, using my repository link:\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \f1 https://raw.githubusercontent.com/daniellumertz/DanielLumertz-Scripts/master/index.xml\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Installation Steps:\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 0.\tx360\tab Install {\field{\*\fldinst{HYPERLINK "https://reapack.com"}}{\fldrslt{\ul
ReaPack
}}}
 if you haven't already\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 1.\tx360\tab Open REAPER\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 2.\tx360\tab Go to Extensions \u8594 ? ReaPack \u8594 ? Import repositories...\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 3.\tx360\tab Paste the repository URL above\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 4.\tx360\tab Click OK and wait for the repository index to download\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 5.\tx360\tab Go to Extensions \u8594 ? ReaPack \u8594 ? Browse packages to find and install the scripts\sa180\par}
{\pard \ql \f0 \sa180 \li0 \fi0 If you prefer to watch a video tutorial: https://www.youtube.com/watch?v=hucbceV7clg\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel1 \b \fs32 REAPER Scripts Highlights:\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Backup Manager (2025)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Backup Manager is a ReaScript designed to search for .rpp-bak files and delete them. It supports recursive folder scanning and includes an option to keep only the latest N backups in each directory. {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?t=300616"}}{\fldrslt{\ul
More Info
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Clouds (2025)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Clouds is a REAPER script designed for experimenting with texture generation. With it, you create a "Cloud Item" that stores settings and defines the texture's position. The texture is created by copying, granularizing, and randomizing a group of items (audio/MIDI/video). {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?t=298170"}}{\fldrslt{\ul
More Info
}}}
, {\field{\*\fldinst{HYPERLINK "https://www.youtube.com/watch?v=IWLGhHi0nnE"}}{\fldrslt{\ul
Video
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 It's Gonna Phase (2024)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 A script for experimenting with phasing, inspired by Steve Reich and Brian Eno methods. {\field{\*\fldinst{HYPERLINK "https://forums.cockos.com/showthread.php?t=289413"}}{\fldrslt{\ul
More Info
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Adaptive Music Trilogy: Layers, ReaGoTo, Alternator (2023)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 A set of 3 scripts for adaptive music techniques in REAPER: Layers, Horizontal Sequences, and Alternations. Dedicated to game music techniques and live music. {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?t=276313"}}{\fldrslt{\ul
More Info
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Bartoker (2022)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Script dedicated to generate small compositions with a structure from Bartok's {\i Music for Children N\u186 ?3}. The user is encouraged to experiment with the parameters to diverge from the original composition. This approach for music generation reflects how I study my references: identifying and experimenting with structures, resources, and characteristics, rather than replicating a style. {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?p=2583193"}}{\fldrslt{\ul
More Info
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 MIDI Toolkit (2022)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 A collection of 4 modules for manipulating MIDI parameters: Copy Paste, Rotator, Mapper, and Serializer. Designed for experimenting with parametric composition and serialism techniques. {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?t=272241"}}{\fldrslt{\ul
More Info
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Markov Chains (2022)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 A script for symbolic music generation using Markov chains algorithm. Generates variations of MIDI items using transition probabilities, allowing manipulation of pitch, interval, rhythm, measure position, and velocity. {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?p=2606674"}}{\fldrslt{\ul
More Info
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Track Snapshot (2022)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 A script to save and load track states in REAPER. {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?t=264124"}}{\fldrslt{\ul
More Info
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Microrhythms (2022)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Based on Malcolm Braff's work, this script allows users to experiment with rhythm interpolation between equal divisions and user-defined ratios. {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?p=2575284"}}{\fldrslt{\ul
More Info
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Fake Grids (2022)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 A script to create a flexible grid by placing markers in REAPER, useful for complex time signatures or microrhythms. {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?t=272321"}}{\fldrslt{\ul
More Info
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Item Sampler (2022)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 A sequencer that places audio or MIDI items at MIDI notes. It can serve as a random sequencer to generate musical ideas. {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?t=262927"}}{\fldrslt{\ul
More Info
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 ReaShare (2022)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 A script to share REAPER projects, tracks, and items by copying and pasting text, simplifying file sharing for quick collaboration or bug reporting. {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?p=2568492"}}{\fldrslt{\ul
More Info
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 MIDI Transfer (2021)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 A script that assists in interfacing MIDI from external software to REAPER. Making external software act as a MIDI editor for REAPER. Useful for notation editors (MuseScore, Sibelius, Dorico) and algorithm composition frameworks. {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?t=248475"}}{\fldrslt{\ul
More Info
}}}
\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Sample Organizer (2021)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 A script for organizing and grouping samples by cutting and placing them into designated positions. It's useful for sample pack creation and improvisation sessions. {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?t=255294"}}{\fldrslt{\ul
More Info
}}}
\par}
