{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 MOD of BirdBird Envelope Palette\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Mod of {\field{\*\fldinst{HYPERLINK "https://forum.cockos.com/showthread.php?p=2643774"}}{\fldrslt{\ul
