{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Split Items in MIDI Notes\par}
{\pard \ql \f0 \sa180 \li0 \fi0 This script processes selected media items to split MIDI notes into individual items. It can optionally copy only note events, trim notes to item edges, and rename the resulting items based on their pitch. Each MIDI note is isolated into its own media item while maintaining timing and playback rate integrity.\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Multikey\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Script to add multikey functionality, simillar to VIM. Edit multikey_bind.txt to add your commands and actions. Forked from Lermerchand Script.\par}
{\pard \ql \f0 \sa180 \li0 \fi0 \outlinelevel2 \b \fs28 Render Selected Items In New Tracks\par}
{\pard \ql \f0 \sa180 \li0 \fi0 For each selected item, render its track within the item's time range and place the resulting item on a new track.\par}
